import { Stack } from "@mui/material";
import Slider from "./components/Slider";
import AboutMe from "./components/AboutMe";

export default function Home() {
  return (
    <Stack spacing={2}>
      <Slider />
      <AboutMe />
    </Stack>
  );
}
